(defn clean-R-relevant [s] (-> (str/replace s #"\n\n### Examples(?s).*```" "") (str/replace ":::: container\n::: container\n" "") (str/replace #"### Usage(?s).*```" "") (str/replace "R Documentation" "Documentation") (str/replace "|--------------|-----------------|" "")))(defn doc-url->md [doc] (clean-R-relevant (.. (FlexmarkHtmlConverter/builder) build (convert (slurp doc)))))(defn _fetch-dataset [csv] (-> csv (tc/dataset {:key-fn csk/->kebab-case-keyword})))
(def fetch-dataset (memoize _fetch-dataset))
(defn AER-Affairs "Data description: https://vincentarelbundock.github.io/Rdatasets/doc/AER/Affairs.html" {:doc-link "https://vincentarelbundock.github.io/Rdatasets/doc/AER/Affairs.html"} [] (fetch-dataset "https://vincentarelbundock.github.io/Rdatasets/csv/AER/Affairs.csv"))
(alter-meta! (var AER-Affairs) (fn [var-m] (assoc var-m :doc (doc-url->md (:doc-link var-m)))))
